import { StoreContext } from './store';

function Sample1() {
  return (
      <StoreContext.Consumer>
        <div>Sample 1 = {state => state.count}</div>
        {value => console.log('value', value)}
      </StoreContext.Consumer>
  );
}

export default Sample1;
